import React, { useState } from 'react';

                function Example() {
                  // Declare a new state variable, which we'll call "count"
                  const [count, setCount] = useState(0);

                  return (
                    <div>
                      <h1>You clicked {count} time(s).</h1>
                      <button onClick={() => setCount(count + 1)}>
                        Click me
                      </button>
                    </div>
                  );
                }
export default Example;
